    disabled: false,
    from: moment('01:00:00', 'HH:mm:ss'),
    to: moment('23:00:00', 'HH:mm:ss'),
  },
  {
    title: 'friday',
    disabled: false,
    from: moment('01:00:00', 'HH:mm:ss'),
    to: moment('23:00:00', 'HH:mm:ss'),
  },
  {
    title: 'saturday',
    disabled: false,
    from: moment('01:00:00', 'HH:mm:ss'),
    to: moment('23:00:00', 'HH:mm:ss'),
  },
  {
    title: 'sunday',
    disabled: false,
    from: moment('01:00:00', 'HH:mm:ss'),
    to: moment('23:00:00', 'HH:mm:ss'),
  },
];
